import React, { Component } from 'react';
import ReactBootstrap, {Container, Row, Col, FormGroup} from 'react-bootstrap'; 

class SuggestionBox extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			suggested_items: []
		}
	}
	render() {
	    return (
			<div className='suggest-box-wrapper'>
				<ul>
					{this.state.suggested_items}
				</ul>
			</div>
	    )
	}

	componentWillReceiveProps() {		
		// console.log(this.props);
	}

	componentDidUpdate(prevProps) {	

		// console.log('*' + this.props.suggestions);

		this.state.suggested_items.push(this.props.suggestions);

		const unique_fruits = new Set(this.state.suggested_items);
		const fruits_arr = [...unique_fruits];

		console.log(fruits_arr);

		// this.state.suggested_items.push(<li>{fruits_arr.splice(0, 0, '')}</li>);

	}
}

export default SuggestionBox;
